script: |
  super -f tsv -I q6985.sql | sort > q6985.out

vector: true

inputs:
  - name: q6985.sql
    data: |
      SELECT tab0.col2 AS col1 FROM tab0 WHERE NOT + col0 + + col1 BETWEEN + col0 * + col0 * + tab0.col2 + col1 * col1 AND ( col1 * + col1 );
  - name: tab0

outputs:
  - name: q6985.out
    data: |
      1
      33
      82
